  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer portrays the State boundaries
  of the United States, Puerto Rico, and the U.S. Virgin Islands. The map layer was
  created by extracting county polygon features from the CENSUS 2006 TIGER/Line files
